func Convert_Float(vals [][]int, mymap map[int][]float64) [][][]float64 {
	total := [][][]float64{}
	for _, i := range vals {
		newlist := [][]float64{}
		for _, ii := range i {
			newlist = append(newlist, RoundPt(mymap[ii]))
		}
		total = append(total, newlist)
	}
	return total

}

